*/

// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Box from '@mui/material/Box';
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import {useState} from 'react';
import DataTable from "examples/Tables/DataTable";
// Data
import CompanyEntry from "layouts/companyEntry/companyEntry.js";
import MDButton from "components/MDButton";
//modal
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import TextField from '@mui/material/TextField';
import { Autocomplete } from "@mui/material";

function CompanyData() {
  const { columns, rows } = CompanyEntry();

  const [formData, setFormData] = useState({
    cname: "",
    role: "",
    eligibility: "",
    uid: "",
    open_date: "",
    close_date: "",

  });

  const [open, setOpen] = useState(false);

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
 const handleSubmit = async ()=>{
  console.log(formData)
  try {
    const response = await fetch(`http://localhost:5001/companyAdd`, {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify(formData),
    });
    const result = await response.json();
    alert("success");
    setOpen(false);
  setFormData({
    cname: "",
    role: "",
    eligibility: "",
    uid: "",
    open_date: "",
    close_date: "",

  })
  } catch (error) {
    console.log(error);
  }

 }
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
                display="flex"
                justifyContent="space-between" // To space elements evenly
                alignItems="center" // Align items vertically
              >
                <MDTypography variant="h6" color="white">
                  Company Details
                </MDTypography>
                <MDButton color="success" onClick={handleOpen}>
                  Add new offer
                </MDButton>
              </MDBox>
              <MDBox pt={3}>

              <DataTable
                table={{ columns, rows }}
                isSorted={false}
                entriesPerPage={true}
                showTotalEntries={true}
                noEndBorder
              />
              </MDBox>
              <Dialog maxWidth="lg" open={open} onClose={handleClose}>
                <DialogTitle>Modal Title</DialogTitle>
                <DialogContent>
                  <DialogContentText>
                        <Box
                                component="form"
                                sx={{
                                  '& .MuiTextField-root': { m: 2, width: '100ch' },
                                }}
                                noValidate
                                autoComplete="off"

                              >

                                <TextField
                                  required
                                  id="outlined-required"
                                  label="Compmay name"
                                  placeholder="Company name"
                                  value={formData.cname}
                                  onChange={(e)=>{setFormData({...formData,cname:e.target.value})}}
                                /><br></br>
                                <TextField
                                  required
                                  id="outlined-required"
                                  label="Role"
                                  value={formData.role}
                                  onChange={(e)=>{setFormData({...formData,role:e.target.value})}}
                                  placeholder="Role"
                                />
                                <TextField
                                  required
                                  id="outlined-required"
                                  label="Eligibility"
                                  placeholder="Eligibility"
                                  value={formData.eligibility}
                                  onChange={(e)=>{setFormData({...formData,eligibility:e.target.value})}}
                                />
                                <TextField
                                  required
                                  id="outlined-required"
                                  type="date"
                                  label="Open date"
                                  placeholder="Open date"
                                  value={formData.open_date}
                                  onChange={(e)=>{setFormData({...formData,open_date:e.target.value})}}
                                />
                                <TextField
                                  required
                                  id="outlined-required"
                                  type="date"
                                  label="End date"
                                  placeholder="end date"
                                  value={formData.close_date}
                                  onChange={(e)=>{setFormData({...formData,close_date:e.target.value})}}
                                />

                          </Box>
                  </DialogContentText>
                </DialogContent>
                <DialogActions>
                  <MDButton onClick={handleSubmit} color="primary" autoFocus>
                    Save
                  </MDButton>
                </DialogActions>
              </Dialog>
            </Card>
          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default CompanyData;
